    {
      "imgName" : "carousel-item active",
      "imgsrc" : "/images/img1.jpg",
      "imgalt" : "First slide",
      "caption" : "iuuadf",
      "href" : "#"
    },
    {
      "imgName" : "carousel-item",
      "imgsrc" : "/images/img2.jpg",
      "imgalt" : "Second slide",
      "caption" : "jirkklsfh",
      "href" : "#"
    },
    {
    "imgName" : "carousel-item",
    "imgsrc" : "/images/img3.jpg",
    "imgalt" : "Third slide",
    "caption" : "jirkklsfh",
    "href" : "#"
  }
]
export default CarouselItems;
